void model_init(){
    conv_layer0 = init_conv_layer0(); // Capa convolucional 1
    conv_layer1 = init_conv_layer1(); // Capa convolucional 2
    dense_layer0 = init_dense_layer0(); //Capa densa 1
    dense_layer1 = init_dense_layer1(); //Capa densa 2
}



int model_predict(data_t input, flatten_data_t * results){
    data_t output;
    flatten_data_t f_input;

    // Input


  // Capa 1: Conv 2D
    conv2d_layer(conv_layer0,input,&output);    // Aplicar la convolución  de la capa
    relu(output);                           // Activación Capa ?: relu
  //free(input.data);
  input=output;
  // Capa 2: MaxPooling2D
  max_pooling_2d(3,input,&output);
  //free(input.data);
  input=output;
  // Capa 3: Conv 2D
    conv2d_layer(conv_layer1,input,&output);    // Aplicar la convolución  de la capa
    relu(output);                           // Activación Capa ?: relu
  //free(input.data);
  input=output;
  // Capa 4: Flatten
    flatten_data_t f_output;
    flatten_layer(output, &f_output);
    //free(output.data);
    f_input=f_output;
  // Capa 5: Dense
    dense_forward(dense_layer0,f_input,&f_output);
    //free(f_input.data);

    //Activación Capa 5: relu
    relu_flatten(f_output);
    f_input = f_output;

  // Capa 6: Dense
    dense_forward(dense_layer1,f_input,&f_output);
    //free(f_input.data);

    //Activación Capa 6: softmax
    softmax(f_output);
  int result= argmax(f_output);
  *results = f_output;
  return result;
}
